import React, { useEffect } from "react"

export default function SupportPage() {
  useEffect(() => {
    const script = document.createElement("script")

    script.src = "/assets/js/mdb.min.js"
    script.async = true

    document.body.appendChild(script)

    return () => script.remove()
  }, [])
  return <></>
}
